import { Routes, Route } from "react-router-dom";
import SignupLoginPage from "./components/SignupLoginPage";
import "./App.css";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import DashboardAndAnalyticsPage from "./components/DashboardAndAnalyticsPage";
import QnAQuestionsAnalysis from "./components/QnAQuestionsAnalysis";

function App() {
  return (
    <div>
      <ToastContainer position="top-right" />
      <Routes>
        <Route path="/" element={<SignupLoginPage />}></Route>
        <Route
          path="/dashboard"
          element={<DashboardAndAnalyticsPage />}
        ></Route>
        <Route path="/qnaanalysis" element={<QnAQuestionsAnalysis />}></Route>
      </Routes>
    </div>
  );
}

export default App;
